import React from 'react';
import { Container, AppBar, Typography, Grow, Grid } from '@material-ui/core';
import appBarImg from './images/appbarlogo.jpg';
import Posts from './components/Posts/Posts';
import Form from './components/Form/Form';


const App = () => {
    return (
        <Container>
            <AppBar>
                <Typography variant="h2" align="center">Social Media App</Typography>
                <img src={appBarImg} alt="appBarImg" height="60" />
            </AppBar>
            <Grow in>
                <Container>
                    <Grid type="container" justify="space-between" align-items="stretch" spacing={3}>
                        <Grid item xs={12} sm={7}>
                            <Posts />
                        </Grid>
                        <Grid item xs={12} sm={4}>
                            <Form />
                        </Grid>
                    </Grid>
                </Container>
            </Grow>
        </Container>
    )
}

export default App;
